import React from 'react'
import s from './Content.module.css'

function Content() {

    return (
        <div className={s.Content}>
            <div className={s.Text}>Warning: Объект переполнен...</div>
            <button on className={s.button}>OK</button>
        </div>
    );
}


export default Content;
